import { ChatGoogleGenerativeAI } from "@langchain/google-genai";
import readlineSync from "readline-sync";
import * as readline from "readline";
// import { HumanMessage } from "@langchain/google-genai";
import "dotenv/config";
import extractTextFromBase64 from "./pdfParser.js";
// import extractTextFromBase64 from "./pdfParser.js";
const model = new ChatGoogleGenerativeAI({
  model: "gemini-1.5-pro",
  apiKey: process.env.GOOGLE_API_KEY
});

const base64PdfStr = "";

const pdfText = await extractTextFromBase64(base64PdfStr);


async function chatWithBase64PDF(pdfText, question) {
    
  
    const response = await model.invoke(
      `You have access to the extracted text from a PDF document. Based on the provided content, accurately answer the following question: 
      PDF Content: ${pdfText} Question: ${ question} If the answer is not found in the text, respond accordingly.`
    );
  
    return response.content;
  }

function askQuestion(query){
    return new Promise((resolve,reject)=>{
        const data = readlineSync.question(query);
        resolve(data);
    })
}
  

async function main() {
    //Take input from command line
    while(true){

        const question = await askQuestion("Ask question >> ");
       const botRes = await chatWithBase64PDF(pdfText, question);
       console.log("Res >> ", botRes);
    }

}
main();

